import * as React from 'react';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';

export default function Filters() {
  return (
    <Autocomplete
      disablePortal
      id="combo-box-demo"
      sx={{ width: 152 }}
      renderInput={() => <TextField  label="First Name" />}
    />
  );
}
